import React from "react";
import LeftListActiveStyle from "./LeftListActiveStyle"
import ListActive from "./ListActive";

//import ListActive from "./ListActive"

class LeftListActive extends React.PureComponent {
    constructor(props) {
        super(props);
        console.log("CONStr,",props.ListActive)
        this.state = {
          error: null,
          isLoaded: false,
          ListActive: props.ListActive
        };
      }

      Test = () => {
        //this.setState({ListActive: this.props.ListActive})
        return this.state.ListActive.map(item =>{
          return <p>{item.title +" "+item.count}</p>
        })
      }

      render() {
        this.setState({ListActive: this.props.ListActive})
        return (
            <LeftListActiveStyle>
                <h3>LeftListActiveStyle</h3>
                {this.Test()}
                {/*<ListActive/>*/}
            </LeftListActiveStyle>
        )
      }
}


export default LeftListActive;
